The Kids Movie Match is a timed matching game, featuring Movie Covers of Kids Movies.

The first round in the Kids Movie Match is 100 seconds and each after that is 10 seconds less, so will have the time to improve each round.

Another thrilling feature to the Kids Movie Match that makes it even more awesome then just a matching game- you must find the icons that link together in some way! When you make a linked match the game will show the link. You also get some help along the way. You can use the SHUFFLE button 3 times, this mixes up the game pieces so it is easier to find linking matches. You can also use the CHEAT button 3 times, and this will find the matching links for you.

Kids Movie Match is an addictive race to find the matching links, that gets harder each round. Have Fun!!!
